// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

const Navbar = () => {
  const { user, logout, isSuperAdmin } = useAuth();

  // Debug logging
  console.log('Navbar rendering with user:', user);
  console.log('User role:', user?.role);
  console.log('IsSuperAdmin result:', isSuperAdmin());

  return (
    <nav className="bg-white shadow-lg">
      <div className="container mx-auto px-6 py-3">
        <div className="flex justify-between items-center">
          <Link to="/" className="text-xl font-bold">
            Tracks
          </Link>
          <div className="flex items-center space-x-4">
            {user ? (
              <>
                <Link to="/dashboard" className="text-gray-800 hover:text-gray-600">
                  Dashboard
                </Link>

                {/* Debug display */}
                <span className="text-sm text-gray-600">
                  Role: {user.role}
                </span>

                {user.role === 'SUPERADMIN' && (
                  <Link 
                    to="/admin/companies" 
                    className="bg-purple-500 hover:bg-purple-600 text-white px-4 py-2 rounded"
                  >
                    Manage Companies
                  </Link>
                )}

                <button
                  onClick={logout}
                  className="bg-red-500 hover:bg-red-600 text-white px-4 py-2 rounded"
                >
                  Logout ({user.firstName})
                </button>
              </>
            ) : (
              <>
                <Link to="/login" className="text-gray-800 hover:text-gray-600">
                  Login
                </Link>
                <Link to="/register" className="bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 rounded">
                  Register
                </Link>
              </>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
